// About.js
import React from 'react';

function About() {
  return (
    <div>
      <h2>About Us</h2>
      <p>Welcome to Our Airbnb Booking Site! We're dedicated to curating unforgettable travel experiences for our guests worldwide. Our platform connects travelers with a diverse array of accommodations, from cozy apartments to spacious villas, ensuring that every stay is as unique as the destination itself. With a focus on quality, safety, and affordability, we strive to make travel accessible to all while fostering a sense of community and cultural exchange. Join us in exploring the world one stay at a time.</p>

    </div>
  );
}

export default About;
